import axios from "axios";
import { useEffect } from "react";





const UseWeather = (props?:GeolocationPosition) => {

    useEffect(() => {
        axios
      .get(
        `http://api.openweathermap.org/data/2.5/weather?units=metric&lat=${props?.coords.latitude.toString()}&lon=${props?.coords.longitude.toString()}&appid=${
          process.env.WEATHER_KEY
        }`
      )
      .then((result) => {
        console.log(result.data);

      });

    },[props]);


    return ''
}


export default UseWeather
